INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (1950, CONCAT('Tsubasa Chronicle'), CONCAT('During an excavation at the mysterious ruins in Clow Country, Syaoran discovers his childhood friend Princess Sakura appear on the site with wings that disperse into many feathers. As the feather', CHAR(39), 's disappear to different dimensions, so does Sakura', CHAR(39), 's memory. In attempts to save Sakura', CHAR(39), 's life and restore her memory, Syaoran travels through to another world to find a solution. There', CHAR(39), 's only one thing left he can do. Travel through to different dimensions to collect Sakura', CHAR(39), 's feathers. Helping out with the quest is Kurogane, an exiled ninja from Japan Country who wishes to return to his world, the runaway magician, Fay, who desires to jump between each world never to return to his own and the white meat-bun shaped creature, Mokona.'), 1, '2005-04-09', '2005-10-15', 'Spring 2005', '25 min. per ep.', 'https://cdn.myanimelist.net/images/anime/9/6555.jpg');
